tables.table_schema:
CREATE TABLE InfluencerCampaignPerformance (
  influencer_id UUID PRIMARY KEY,
  reach INT,
  impressions INT,
  conversion_rates DECIMAL
);

CREATE TABLE influencer_campaigns (
    id INT PRIMARY KEY,
    influencer_name VARCHAR,
    reach INT,
    impressions INT,
    conversion_rate FLOAT
);

CREATE TABLE campaign_engagements (
    id INT PRIMARY KEY,
    campaign_id INT,
    engagement_value FLOAT,
    engagement_date DATE
);

CREATE TABLE campaign_conversions (
    id INT PRIMARY KEY,
    campaign_id INT,
    conversion_value FLOAT,
    conversion_date DATE
);

CREATE TABLE campaign_performance (
    id INT PRIMARY KEY,
    campaign_id INT,
    reach INT,
    impressions INT,
    conversions INT
);

CREATE TABLE ReachMetrics (
    id INT PRIMARY KEY,
    campaign_id INT,
    reach_count INT,
    date DATE
);

CREATE TABLE ImpressionsMetrics (
    id INT PRIMARY KEY,
    campaign_id INT,
    impression_count INT,
    date DATE
);

CREATE TABLE ConversionRates (
    id INT PRIMARY KEY,
    campaign_id INT,
    conversion_rate FLOAT,
    date DATE
);

CREATE TABLE CampaignTags (
    campaign_id INT,
    tag_name VARCHAR(50),
    PRIMARY KEY (campaign_id, tag_name)
);
